import React, { Component } from 'react';
import { Route, Switch } from 'react-router-dom';

import { isLoaded } from 'react-redux-firebase';
import Loading from 'components/Loading';
import PageList from './routes/PageList';
import PageMatch from './routes/PageMatch';

import Header from '../../components/Header'

export default class PageResultsLayout extends Component {
  render() {
    if (!isLoaded(this.props.matches)) {
      return (
        <div style={{ height: 300 }}>
          <Loading />
        </div>
      );
    }

    return (
      <div className="PageResults">
        <Switch>
          <Route
            exact
            path="/app/results"
            render={props => <PageList {...this.props} />}
          />
          <Route
            exact
            path="/app/results/:match"
            render={props => (
              <PageMatch
                matches={this.props.matches}
                email={this.props.email}
                match={props.match.params.match}
                uid={this.props.uid}
                name={this.props.name}
                unreadMessage={(uid, status) => {
                  this.props.unreadMessage(
                    props.match.params.match,
                    uid,
                    status,
                  );
                }}
                // survey={this.props.survey}
              />
            )}
          />
        </Switch>
      </div>
    );
  }
}
